import logo from './logo.svg';
import './App.css';
import react,{ Component} from 'react'
import Header from './Header.js';
import Footer from './Layout/Footer.js';
import Left from './Layout/Left';
class App  extends Component {
  constructor(props){
    super(props)
  }
  render(){
    return (
      <>
        <Header/>
            <section>
                <div className="container">
                  <div className="row">
                      <Left/>
                      {/* {this.props.children} */}
                  </div>
                </div>
            </section>
        <Footer/>
      </>
    )
  }
}

export default App;
